import { useState, useEffect } from 'react'

import { getResults, createResult } from '../../utils/result';

export default function ResultsPage() {

    const [courseName, setCourseName] = useState("")
    const [studentName, setStudentName] = useState("")
    const [score, setScore] = useState("")
    const [results, setResults] = useState([])
    const [error, setError] = useState(false)

    useEffect(() => {
        getAll();
    }, []);

    async function getAll() {
        const resultsAll = await getResults();
        setResults(resultsAll)
    }

    function handleChange(e) {
        if (e.target.name === "courseName") setCourseName(e.target.value);
        if (e.target.name === "studentName") setStudentName(e.target.value);
        if (e.target.name === "score") setScore(e.target.value);

    }


  return (
    <>
        <h1>Results Page</h1>
        <hr />
        <form>
            <div>
            <span>Course name</span><br/>
            <input name="firstName" type="text" value={firstName} autoComplete="off" onChange={handleChange} required />
            </div>

            <div>
            <span>Student name</span><br/>
            <input name="familyName" type="text" value={familyName} autoComplete="off" onChange={handleChange} required />
            </div>

            <div>
            <span>Score</span><br/>
            <input name="dateOfBirth" type="date" value={dateOfBirth} onChange={handleChange} required />
            </div>
            <br/>
            {error ?
            <label>All fields must be filled</label> : ""}
            <br/>
            <button onClick={handleSubmit}>Submit</button>
        </form>
        <div className='Result'>
            <table className='table'>
                <thead>
                    <tr>
                <th>Course</th>
                <th>Student</th>
                <th>Score</th>

                    </tr>
                </thead>
                <tbody>
                    {results.map((r) => {
                    return (
                        <tr key={r._id}>
                        <td>{r.courseName}</td>
                        <td>{r.studentName}</td>
                        <td>{r.score}</td>
                        </tr>
                    );
                    })}
                </tbody>
            </table>
        </div>
    </>
  )
}
